let list_take elts n =
  let rec loop elts accum count =
    if count >= n then
      (List.rev accum)
    else
      match elts with
      | [] -> raise (Internal_error "list_take: list too short")
      | (h :: t) ->
        loop t (h::accum) (count + 1)
  in
  loop elts [] 0

