let create_side_chain_user_state user_keys =
  let main_chain_user_state =
    Main_chain.UserState.
      { keypair= user_keys
      ; confirmed_state= Digest.zero
      ; confirmed_balance= TokenAmount.zero
      ; pending_transactions= []
